import React from 'react';
import ReactDOM from 'react-dom';

const TodoStatusFilter = () => {
    return (
        <div>
            <input type="button" value={'all'}/>
            <input type="button" value={'active'}/>
            <input type="button" value={'done'}/>


        </div>
    )
}



const TodoSearch = () => {
    return (
        <div>
            <input type="text"/>
        </div>
    )
}

const TodoList = () => {
    return (
        <div>
            <ul>
                <li><TodolistItem label='Drink Coffee' /></li>
                <li><TodoSearch label='Learn React' /></li>
                <li><TodolistItem label='Drink vodka' /></li>
            </ul>
        </div>
    )
}

const TodolistItem = () => {

    return (
        <span>Drink Coffee</span>
    )
}

const TodoHeader = () => {
    return (
        <div>
            <TodoSearch />
            <TodoStatusFilter />
            <TodoList />
        </div>
    )
};

const App  = () => {
    return (
        <div className={'wrapper'}>
            <TodoHeader />


        </div>
    )
}
ReactDOM.render(<App />,document.getElementById('root'));
